/* eslint-disable */

function addAvenirNextLTProDemiFont(jsPDFAPI) {
  var font = '';
  var callAddFont = function() {
    this.addFileToVFS('AvenirNextLTProDemi.ttf', font);
    this.addFont('AvenirNextLTProDemi.ttf', 'avenir-demi', 'normal');
  };
  jsPDFAPI.events.push(['addFonts', callAddFont]);
}

export default addAvenirNextLTProDemiFont;
